import React, { Component } from 'react'
import style from './Fifth.module.css'

class Fifth extends Component {
  render() {
    return (
      <div id={style.fifth}>
        <h2>Questions ?</h2>
        <p>We've got answers</p>
        <div>What is Spotify Premium?</div>
        <div>Hw do I cancel?</div>
        <div>How does the Duo and Family plan work?</div>
        <div>How many devices can I listen to?</div>
        <div>How does the student plan work?</div>
      </div>
    )
  }
}

export default Fifth
